import classes from "./FoodList.module.css";
import Input from "./Input";
import images from "../Images/pix1.webp";

const FoodList = () => {
  const defaultFood = [
    {
      src: images,
      title: "Fries With Chicken ðŸ”¥ cheese burger",
      price: 25.14,
    },
    { src: images, title: "Pizza with Leaves And StrawBerry", price: 19.28 },
    { src: images, title: "Beef Cheese Burher ðŸ”¥ with sausages", price: 43.12 },
    {
      src: images,
      title: "Hungry Meal with burger and fries nd sausages",
      price: 14.22,
    },
  ];

  const lists = defaultFood.map((food) => (
    <li>
      <img src={food.src} />
      <div>
        <p>{food.title}</p>
        <p>{food.price}</p>
      </div>

      <Input />
    </li>
  ));

  return (
    <div>
      <ul className={classes.ul}>{lists}</ul>
    </div>
  );
};

export default FoodList;
